script: |
  super -f text -I q4094.spq | sort > q4094.out

inputs:
  - name: q4094.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE - - col2 * CAST ( 35 AS INTEGER ) + - - col1 - + col1 NOT BETWEEN - + col0 - + col2 AND NULL;
  - name: tab1

outputs:
  - name: q4094.out
    data: |
